INSERT INTO `ad` VALUES ('184729021','MG','MG 5','Automatic',2022,1400,1500,'Auto 4 You','201026697964','اقل سعر وتسليم فوريجميع الفأت والألوان\nاستمتع بفائدة تبدأ من 7.5٪\nعروض بدون مقدم\nعروض بدون حظر\nعروض بدن مصاريف اداريةوتامين اول سنة هدية\nمتاح أنظمة تقسيط اظباط الشرطة والقوات المسلحة\nعروض خاصة للموظفين وأصحاب العمل\nادفع مقدم ٢٥٪ والقسط الباقي لمدة تصل إلى ٧ سنين\nللاستفسار 01013193500\n01117007849\n\n\nauto 4 you دائما الافضل\n21 محمد يوسف موسى مدينه نصر عباس العقاد خلف بنزينه توتال','Blue- Navy Blue','Benzine','New','Sedan','Installments',NULL,'2023-03-25',160000,NULL,NULL,'Nasr City',' Cairo',NULL,NULL,NULL),('187822602','Ford','Fiesta','Automatic',2019,1000,1300,'Hatem','201006737373','. سياره فورد فيستا تم شراءه في ٢٠٢٠ل\nHigh line . LED. Panoramic roof','Blue- Navy Blue','Benzine','Used','Hatchback',NULL,NULL,'2023-03-26',520000,40000,49999,'New Cairo - El Tagamoa',' Cairo',NULL,NULL,NULL),('188464586','Lada','Granta','Manual',2023,1600,1600,'ال عثمان اوتو','201226177005','لادا جرانتا مانيوال 2023 استلام فوري بخصم كبير كل الالوان و باسعار زما\n\nبرغم غلاء الاسعار و ارتفاع الدولار عملنا عروضنا نار وعليك الاختيار. . . \nخصومات بجد مش هزار\nبمقدم يبدأ من 25% و بأقل سعر للفايدة في مصر\nوإمكانية تقسيط مع جميع البنوك\nماتفوتش فرصتك واحجز عربيتك دلوقتي من آل عثمان وخليك انت الكسبان\nلتفاصيل اكتر ابعتلنا رقمك علي رسائل الصفحة\nاو زوروا معرضنا في :\nالدائرى : بعد نزلة مؤسسة الزكاة بجوار بنزينة موبيل','Gray','Benzine','New','Sedan','Installments',NULL,'2023-03-19',64000,NULL,NULL,'Marg',' Cairo',NULL,NULL,NULL),('190040454','Toyota','Fortuner','Automatic',2023,2200,2800,'ال عثمان اوتو','201210652614','3- أقل فائدة بنكية فى مصر\n6- الإستلام فى 48 ساعة \n7- يمكنك البدل بسيارتك المستعملة وبأفضل الأسعار\n8- عروض خاصة لربة المنزل بالبطاقة فقط وبدون ضامن\n9- إمكانية التقسيط المباشر لأى ماركة\n\nجراند شيروكى – تويوتا فورتشنر . . . . . . . إلخ للإستعلام لقسم مستعمل الحالات النادرة : 01210652614\n\nإسأل على هديتك الحصرية فقط من أل عثمان\n\nتويوتا فورتشنر 2023 بالتقسيط استلام فوري كل الالوان باسعار زمان','Gray','Benzine','New','4X4','Installments',NULL,'2023-03-19',300000,NULL,NULL,'Marg',' Cairo',NULL,NULL,NULL),('193007613','Chevrolet','Pickup/Dababa','Manual',2023,3000,3000,'ال عثمان اوتو','201210652614','فرصة لا تعوض من ملوك النقل في مصر \nاكبر اسطول سيارات نقل وباقل الاسعار وافضل برامج التقسيط \n\nبشري لاصحاب الشركات و السجلات التجارية مقدم من اول 20% تقسيط شركات / بنوك \nكما يوجد لدينا نظام القسط المباشر\n\nجامبو8000 2023 استلام فوري بالتقسيط باقل سعر في السوق\n\nموديل 2023\nاسعار و مقدمات زمان الحقها دلوقتي من ال_عثمان \nعرض خـــــــاص لاصحاب الشركات و المصانع (سجل تجاري - بطاقة ضريبية)\nشغال او مش شغال هتركب يعني هتركب مع امكانية الاستلام الفوري في حالة التقسيط\nيوجد لدينا جميع انواع السيارات التجارية (نــــــــــقل - مــــــــيكروباص)\nمستني ايه؟! اسأل عن التفاصيل دلوقتي \n زوروا معرضنا في: \nالدائرى : بعد نزلة مؤسسة الزكاة بجوار بنزينة موبيل','Red','Diesel','New','Pickup','Installments',NULL,'2023-03-19',260000,NULL,NULL,'Marg',' Cairo',NULL,NULL,NULL),('193198968','Nissan','Sunny','Automatic',2023,1400,1500,'El Togary Auto','201022883851','العربيه اللي نفسك فيها في التجاري اوتو هتلاقيها\nتسليم فوري \nمقدمات تبدأ من ٢٥٪؜ \nفترة سداد تصل ل ٨ سنوات \n- متاح جميع انظمة التقسيط \n- للموظفين قطاع عام وخاص واصحاب السجلات التجاريه \n- اصحاب المعاشات \n- ظباط الجيش والشرطه \n- عرض خاص للاطباء \n- متشيلش هم التأمين او المصاريف الاداريه\n-مفيش شغل هتقسط ببطاقتك بس بمقدم 40٪؜ \nكلمنا فورا وفي التجاري أوتو عربيتك هتلاقيها\n-ولسه العروض مش هتخلص كلمنا وقارن بنفسك \nللتواصل كلمنا على\n01022883851 - 01001651118 - 01001346777\n01006626078 - 01050848000 - 01030445841\n01024287484 - 01004047226 - 01120628557\n01146007710 - 01020755513','Gold','Benzine','New','Sedan','Installments',NULL,'2023-03-19',135000,NULL,NULL,'Nasr City',' Cairo',NULL,NULL,NULL),('193416299','Chery','Other','Automatic',2022,1400,1500,'Motor One','201222213338','شيرى تيجو 7 برو كمفورت \nمتاحه بجميع فروعنا \n\nباقل المقدمات ، متاح جميع انظمة التقسيط بالتعاون مع جميع البنوك وشركات التقسيط المباشر \n\nللتفاصيل يرجى التواصل بالمبيعات \n\nالخط الساخن 15807\n\n01222213338\n\nتطبق الشروط والأحكام\n\nعناوين الفروع:\n\nالقاهرة: 7 شارع إبراهيم أبو النجا إمتداد عباس العقاد بجوار شركة إنبى للبترول، مدينة نصر\n\n\n\nالجيزة: 337 شارع السودان، آخر شارع أحمد عرابي، المهندسين\nhttps://maps. google. com/?q=30.068720,31.195354\n\n\nالدقهلية: ميت غمر شارع البحر خلف البنك الأهلى المصري برج الصوفى، امام تصاريح العمل وكنيسة الاروام\nhttps://maps. google. com/?q=30.712662,31.25436\n\nشيرى تيجو 7 برو كمفورت','Silver','Benzine','New','SUV','Installments',NULL,'2023-03-25',202000,NULL,NULL,'Nasr City',' Cairo',NULL,NULL,NULL),('193417037','Hyundai','Bayon','Automatic',2022,1400,1500,'Motor One','201222213338','هيونداى بايون ثالث فئه 2022\n\nمتاحه بجميع فروعنا \n\nباقل المقدمات ، متاح جميع انظمة التقسيط بالتعاون مع جميع البنوك وشركات التقسيط المباشر \n\nللتفاصيل يرجى التواصل بالمبيعات \n\nالخط الساخن 15807\n\n01222213338\n\nتطبق الشروط والأحكام\n\nعناوين الفروع:\n\nالقاهرة: 7 شارع إبراهيم أبو النجا إمتداد عباس العقاد بجوار شركة إنبى للبترول، مدينة نصر\n\n\n\nالجيزة: 337 شارع السودان، آخر شارع أحمد عرابي، المهندسين\nhttps://maps. google. com/?q=30.068720,31.195354\n\n\nالدقهلية: ميت غمر شارع البحر خلف البنك الأهلى المصري برج الصوفى، امام تصاريح العمل وكنيسة الاروام\nhttps://maps. google. com/?q=30.712662,31.25436\n\nهيونداى بايون ثالث فئه 2022','Silver','Benzine','New','Hatchback','Installments',NULL,'2023-03-25',780000,NULL,NULL,'Nasr City',' Cairo',NULL,NULL,NULL),('193806026','Kia','Sportage','Automatic',2022,1600,1600,'Mostafa abd el aziz','201118887282','كيا سبورتاج زيرويوجد عدة أنظمة للتقسيط تصل إلي ٨٤ شهر و استلام خلال ٢٤ ساعه موظفين حكومة و قطاع خاص و أصحاب الأعمال و أيضا أي شخص من دون بيانات عمل\nأنظمة تقسيط من سنه حتي 8 سنوات\nحصريا\n\nفايده8.5 %تقسيط تامين أو مصاريف إدارية هديه\n25% مقدم موظف و صآحب عمل \n٣٠ % موظف أو سائق أو فني أو ممرضه أو أي وظيفه شرط أن يكون يعمل ب شركة\nاستعلام فقط بصورة البطاقة من دون أوراق\n٣٠% لموظف أو صاحب عمل\n  40% بدو